import React from 'react'

export const PadreConVida = () => {
    return (
        <div class="form-check">
            <input class="form-check-input" type="checkbox" name= "padre_con_vida" id="padre_con_vida"/>
            <label class="form-check-label" htmlFor="padre_con_vida">
                Padre con vida
            </label>
        </div>
    )
}
